import React from 'react';
import Skill from './Skill';
import Bar from './Bar';

const SkillsList = ( { skills, setSkills }) => {

    return (
        <div className='skills-container'> 
            <Bar />
            <div className='skills-list'>
                {skills.map( skill => (
                    <Skill 
                        key={skill.id}
                        text={skill.text}
                        level={skill.level}
                        skill={skill}
                        setSkills={setSkills}
                    />


                ))}
            </div>
        </div>
    );
};






export default SkillsList;
